* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html {
  font-size: 62.5%;
}

body {
  font-family: "Lato", sans-serif;
  color: white;
}

.hamburger {
  height: 3rem;
  width: 3rem;
  border: 1px solid white;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
.hamburger span {
  width: 2.4rem;
  display: block;
  border-bottom: 1px solid white;
  margin: 0.3rem 0;
}
.navbar {
  position: fixed;
  z-index: 2;
  height: 6rem;
  background-color: black;
  width: 100%;
  transition: all 1s;
  display: flex;
  justify-content: space-between;
  align-items: center;
  font-size: 1.6rem;
}
.navbar__navbrand {
  margin: 1rem;
}
.navbar__navbrand--link {
  text-decoration: none;
  color: white;
}
.navbar__list {
  list-style: none;
  display: flex;
}
.navbar__list--item {
  margin: 1rem;
}
.navbar__list--link {
  text-decoration: none;
  color: white;
}

.about {
  height: 100vh;
  background-color: #010304;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: 1fr;
}
.about__desc {
  font-size: 1.6rem;
  font-weight: 100;
  margin-top: 2rem;
}
.about__overview {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: baseline;
  position: relative;
  left: 25%;
}
.about__overview--icons {
  margin-top: 4rem;
  display: flex;
  justify-content: start;
}
.about__overview--icon {
  height: 3rem;
  width: 3rem;
  fill: white;
  margin-right: 1rem;
}
.about__title {
  font-size: 5rem;
  font-weight: 100;
}
.about__title--top {
  display: block;
}
.about__title--bottom {
  display: block;
}
.about__title--C {
  display: inline-block;
  padding-bottom: 1rem;
  border-bottom: 3px solid #ffaf29;
}
.about__content {
  display: grid;
  grid-template-columns: repeat(12, 1fr);
  grid-template-rows: repeat(12, 1fr);
  justify-items: center;
  align-items: center;
}
.about__content span {
  font-size: 1.6rem;
  padding-bottom: 0.5rem;
  cursor: pointer;
}
.about__content--intro {
  grid-row: 2/3;
  grid-column: 4/5;
}
.about__content--contact {
  grid-row: 2/3;
  grid-column: 6/7;
}
.about__content--skills {
  grid-row: 2/3;
  grid-column: 8/9;
}
.about__card-intro {
  font-weight: 100;
}
.about__card-intro h2 {
  font-size: 1.5rem;
  margin-bottom: 1rem;
  font-weight: 300;
}
.about__card-intro :nth-child(2) {
  font-size: 3.5rem;
  margin-bottom: 3rem;
}
.about__card-intro :nth-child(3) {
  font-size: 1.5rem;
}
.about__card-intro :nth-child(4) {
  font-size: 1.5rem;
}
.about__card-contact {
  font-weight: 100;
  display: none;
}
.about__card-contact h2 {
  font-size: 1.5rem;
  margin-bottom: 1rem;
  font-weight: 300;
}
.about__card-contact :nth-child(2) {
  font-size: 3.5rem;
  margin-bottom: 3rem;
}
.about__card-contact :nth-child(3) {
  font-size: 1.5rem;
}
.about__card-contact :nth-child(4) {
  font-size: 1.5rem;
}

.active {
  border-bottom: 1px solid #ffaf29;
}

.card {
  grid-row: 3/11;
  grid-column: 4/9;
}

.education {
  height: 100vh;
  background-color: #010304;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: 1fr;
}
.education__details {
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin-left: 5rem;
}
.education__details h2 {
  font-size: 2rem;
  margin-bottom: 1rem;
}
.education__details p {
  font-size: 1.6rem;
  line-height: 1.7;
}

.education__game {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.game-container {
  display: grid;
  grid-template-rows: min-content 5rem min-content;
  grid-template-columns: repeat(12, 1fr);
  justify-items: center;
}

.head-section {
  grid-column: 1/-1;
  width: 100%;
  font-size: 1rem;
  text-transform: uppercase;
  text-align: center;
}

.heading {
  margin: 1rem 0;
}

#color-display {
  text-align: center;
  margin-bottom: 4rem;
  font-size: 1rem;
}

.game-bar {
  width: 100%;
  grid-row: 2/3;
  grid-column: 1/-1;
  display: grid;
  grid-template-columns: repeat(12, 1fr);
  text-align: center;
}

.btn {
  border: none;
  font-size: 1rem;
  color: #ffc014;
  transition: all 0.75s;
  background-color: black;
}

#new-game {
  grid-column: 3/4;
}

#easy-btn {
  grid-column: 9/10;
}

#hard-btn {
  grid-column: 10/11;
}

.message {
  grid-column: 5/8;
  margin: auto;
  font-size: 1.4rem;
}

.winner {
  color: green;
}

.loser {
  color: red;
}

.game-board {
  grid-row: 3/4;
  grid-column: 3/11;
  display: grid;
  grid-template-rows: repeat(2, min-content);
  grid-template-columns: repeat(3, min-content);
  grid-gap: 2rem;
  margin: 5rem 0;
}

.circle {
  height: 8rem;
  width: 8rem;
  background-color: yellowgreen;
  border-radius: 50%;
  transition: all 1s;
}

.landing {
  background-image: url("https://images.unsplash.com/photo-1478760329108-5c3ed9d495a0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60");
  min-height: 100vh;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  transition: all;
}
.landing__title {
  font-size: 10rem;
}
.title-animation {
  animation: text-flicker-in-glow 3s;
}

.sub-animation {
  animation: text-flicker-in-glow 4s ease-out;
}

.portfolio {
  background-image: url("https://images.unsplash.com/photo-1478760329108-5c3ed9d495a0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60");
  min-height: 100vh;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  display: grid;
  grid-template-columns: repeat(13, 1fr);
  grid-template-rows: repeat(13, 1fr);
}
.portfolio__card {
  background-color: grey;
}
.portfolio__card--1 {
  grid-row: 2/5;
  grid-column: 2/5;
}
.portfolio__card--2 {
  grid-row: 2/5;
  grid-column: 6/9;
}
.portfolio__card--3 {
  grid-row: 2/5;
  grid-column: 10/13;
}
.portfolio__card--4 {
  grid-row: 6/9;
  grid-column: 2/5;
}
.portfolio__card--5 {
  grid-row: 6/9;
  grid-column: 6/9;
}
.portfolio__card--6 {
  grid-row: 6/9;
  grid-column: 10/13;
}
.portfolio__card--7 {
  grid-row: 10/13;
  grid-column: 2/5;
}
.portfolio__card--8 {
  grid-row: 10/13;
  grid-column: 6/9;
}
.portfolio__card--9 {
  grid-row: 10/13;
  grid-column: 10/13;
}
.portfolio__card--img {
  width: 100%;
  height: 100%;
}

